column8:
セレブ風の無造作ウェーブヘアが自分で作れちゃう♪くるくるねじって、クリップで留めるだけ☆忙しい朝でもカンタン、ふんわりかわいいウェーブヘアのできあがり！吸水性バツグンのマイクロファイバー使用だから、短時間仕上がり！8個組。<table width='600' border='0' align='center' cellpadding='0' cellspacing='0'><tr><td><img src='https://image.rakuten.co.jp/manpura/cabinet/60000-/0100218-01.jpg' width='600' height='692'><br><img src='https://image.rakuten.co.jp/manpura/cabinet/60000-/0100218-02.jpg' width='600' height='810'><br><img src='https://image.rakuten.co.jp/manpura/cabinet/60000-/0100218-03.jpg' width='600' height='917'><br><img src='https://image.rakuten.co.jp/manpura/cabinet/60000-/0100218-04.jpg' width='600' height='411'></td></tr></table><br><table width='600' border='0' align='center' cellpadding='0' cellspacing='0'><tr><td><h1><font color='#333333' size='3'>濡れた髪の毛にセットするだけ！時間とねじり加減を調整すれば、くっきりウェーブもゆるウェーブも楽しめる♪アメリカのヘアスタイリストDavid Silvaがデザイン！熱や電気を使わないから、髪へのダメージが少なくとっても優しい☆</font></h1></td></tr></table><br><table width='300' border='0' cellspacing='0' cellpadding='0'><tr><td><font color='#333333' size='-1'>セレブ風の無造作ウェーブヘアが自分で作れちゃう♪くるくるねじって、クリップで留めるだけ☆忙しい朝でもカンタン、ふんわりかわいいウェーブヘアのできあがり！吸水性バツグンのマイクロファイバー使用だから、短時間仕上がり！8個組。</font></td></tr></table><br><table width='300' border='0' cellpadding='5' cellspacing='1' bgcolor='#666666'><tr bgcolor='#FFFFFF'><td width='25%' align='center' nowrap bgcolor='#FFFFCC'><font color='#333333' size='-1'>サイズ</font></td><td width='75%' align='left'><font color='#333333' size='-1'>約4.8×5×5.6cm</font></td></tr><tr bgcolor='#FFFFFF'><td align='center' bgcolor='#FFFFCC'><font color='#333333' size='-1'>重量</font></td><td align='left'><font color='#333333' size='-1'>約25g</font></td></tr><tr bgcolor='#FFFFFF'><td align='center' bgcolor='#FFFFCC'><font color='#333333' size='-1'>素材・材質</font></td><td align='left'><font color='#333333' size='-1'>本体：ポリスチレン<br>生地：ポリエステル、ナイロン</font></td></tr><tr bgcolor='#FFFFFF'><td align='center' bgcolor='#FFFFCC'><font color='#333333' size='-1'>製造国</font></td><td align='left'><font color='#333333' size='-1'>中国</font></td></tr></table>
<br>※通常3日～5日前後で配送の予定ですが、人気商品の為、商品欠品の場合、それよりもお時間をいただいたり、商品完売といったご連絡をさせていただくことがございます。ご了承くださいませ。
